DROP VIEW IF EXISTS `vegreso`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vegreso` AS select `cabegreso`.`cegr_fec` AS `cegr_fec`,`cabegreso`.`cegr_obs` AS `cegr_obs`,`cabegreso`.`cegr_id` AS `cegr_id`,`cabegreso`.`Usu_id` AS `Usu_id`,`detegreso`.`degr_id` AS `degr_id`,`detegreso`.`degr_can` AS `degr_can`,`detegreso`.`degr_pu` AS `degr_pu`,`detegreso`.`degr_tot` AS `degr_tot`,`detegreso`.`degr_ppp` AS `degr_ppp`,`productos`.`pro_id` AS `pro_id`,`productos`.`pro_Des` AS `pro_Des`,`productos`.`Pro_uni` AS `Pro_uni`,`productos`.`pro_tip` AS `pro_tip`,`productos`.`prv_id` AS `prv_id`,`productos`.`pro_exmi` AS `pro_exmi`,`productos`.`pro_exma` AS `pro_exma`,`productos`.`pro_ubi` AS `pro_ubi`,`productos`.`pro_cod` AS `pro_cod`,`productos`.`pro_est` AS `pro_est`,`productos`.`pro_aut` AS `pro_aut`,`productos`.`mar_id` AS `mar_id`,`productos`.`gru_id` AS `gru_id`,`marcas`.`Mar_des` AS `Mar_des` from (((`cabegreso` join `detegreso` on((`cabegreso`.`cegr_id` = `detegreso`.`cegr_id`))) join `productos` on((`detegreso`.`pro_id` = `productos`.`pro_id`))) join `marcas` on((`productos`.`mar_id` = `marcas`.`Mar_id`)));

-- ----------------------------
--  View definition for `vingreso`
