DROP VIEW IF EXISTS `vingreso`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vingreso` AS select `productos`.`pro_cod` AS `pro_cod`,`detingreso`.`ding_can` AS `ding_can`,`productos`.`pro_Des` AS `pro_Des`,`productos`.`Pro_uni` AS `Pro_uni`,`detingreso`.`ding_pu` AS `ding_pu`,`detingreso`.`ding_tot` AS `ding_tot`,`cabingreso`.`cingr_id` AS `cingr_id` from ((`cabingreso` join `detingreso` on((`cabingreso`.`cingr_id` = `detingreso`.`cing_id`))) join `productos` on((`detingreso`.`pro_id` = `productos`.`pro_id`)));

